import React from "react";

// Minimal gold partial lines divider
const SectionDivider = ({ className = "" }) => {
  const gold = "#D4AF37"; // warm gold
  return (
    <div className={`flex justify-center my-10 ${className}`}>
      <svg
        width="380"
        height="24"
        viewBox="0 0 380 24"
        xmlns="http://www.w3.org/2000/svg"
        aria-hidden="true"
      >
        <g stroke={gold} strokeWidth="3" strokeLinecap="round" fill="none">
          {/* left partial line */}
          <path d="M20 12 H160" />
          {/* right partial line */}
          <path d="M220 12 H360" />
        </g>
      </svg>
    </div>
  );
};

export default SectionDivider;
